import React, { useState } from 'react';
import { Form, Button, Card } from 'react-bootstrap';

const EventPlanning = () => {
  const [name, setName] = useState('');
  const [date, setDate] = useState('');
  const [venue, setVenue] = useState('');
  const [events, setEvents] = useState([]);
  const [showForm, setShowForm] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    const newEvent = { name, date, venue, subEvents: [] };
    setEvents([...events, newEvent]);
    setName('');
    setDate('');
    setVenue('');
    setShowForm(false);
  };

  const deleteEvent = (index) => {
    const updatedEvents = events.filter((_, i) => i !== index);
    setEvents(updatedEvents);
  };

  const addSubEvent = (eventIndex) => {
    const subEventName = prompt('Enter sub-event name:');
    const subEventDate = prompt('Enter sub-event date:');
    if (subEventName && subEventDate) {
      const updatedEvents = [...events];
      updatedEvents[eventIndex].subEvents.push({ name: subEventName, date: subEventDate });
      setEvents(updatedEvents);
    }
  };

  return (
    <div>
      <Button variant="primary" onClick={() => setShowForm(!showForm)}>
        + Add Event
      </Button>
      {showForm && (
        <Form onSubmit={handleSubmit}>
          <Form.Group controlId="eventName">
            <Form.Label>Event Name</Form.Label>
            <Form.Control
              type="text"
              value={name}
              onChange={(e) => setName(e.target.value)}
              required
            />
          </Form.Group>

          <Form.Group controlId="eventDate">
            <Form.Label>Date</Form.Label>
            <Form.Control
              type="date"
              value={date}
              onChange={(e) => setDate(e.target.value)}
              required
            />
          </Form.Group>

          <Form.Group controlId="eventVenue">
            <Form.Label>Venue</Form.Label>
            <Form.Control
              type="text"
              value={venue}
              onChange={(e) => setVenue(e.target.value)}
              required
            />
          </Form.Group>

          <Button variant="primary" type="submit">
            Create Event
          </Button>
        </Form>
      )}

      <div className="mt-4">
        {events.map((event, eventIndex) => (
          <Card key={eventIndex} className="mb-3">
            <Card.Body>
              <Card.Title className="d-flex justify-content-between align-items-center">
                {event.name}
                <div>
                  <Button
                    variant="info"
                    size="sm"
                    className="mr-2"
                    onClick={() => addSubEvent(eventIndex)}
                  >
                    + Add Sub-Event
                  </Button>
                  <Button
                    variant="danger"
                    size="sm"
                    onClick={() => deleteEvent(eventIndex)}
                  >
                    <i className="bi bi-trash" />
                  </Button>
                </div>
              </Card.Title>
              <Card.Subtitle className="mb-2 text-muted">{event.date}</Card.Subtitle>
              <Card.Text>
                Venue: {event.venue}
              </Card.Text>
              {event.subEvents.length > 0 && (
                <div>
                  <h5>Sub-Events:</h5>
                  <ul>
                    {event.subEvents.map((subEvent, subEventIndex) => (
                      <li key={subEventIndex}>
                        {subEvent.name} - {subEvent.date}
                      </li>
                    ))}
                  </ul>
                </div>
              )}
            </Card.Body>
          </Card>
        ))}
      </div>
    </div>
  );
};

export default EventPlanning;
